collections::btree::set::BTreeSet::<T, A.doc:
Returns the number of elements in the set.

# Examples

```
use std::collections::BTreeSet;

let mut v = BTreeSet::new();
assert_eq!(v.len(), 0);
v.insert(1);
assert_eq!(v.len(), 1);
